import {ExemptionsPage} from '@pages/exemptions-page';
import {SettingsPage} from '@pages/settings-page';
import {UserActionsPage} from '@pages/user-actions-page';


export const routes: Routes = [
  {
    path: '',
    redirectTo: 'profile',
    pathMatch: 'full'
  },
  {
    path: 'profile',
    component: ProfilePage,
  },
  {
    path: 'students',
    component: StudentsPage
  },
  {
    path: 'users',
    component: UsersPage
  },
  {
    path: 'settings',
    component: SettingsPage
  },
  {
    path: 'user-actions',
    component: UserActionsPage
  },
  {
    path: 'events',
    component: EventsPage
  },
  {
    path: 'documents',
    component: DocumentsPage,
    children: [
      {
        path: 'petitions',
        component: PetitionsPage
      },
      {
        path: 'reports',
        component: ReportsPage
      },
      {
        path: 'exemptions',
        component: ExemptionsPage
      }
    ]
  },
  {
    path: 'statistic',
    component: StatisticsPage
  },
  {
    path: 'calendar',
    component: CalendarPage
  },

];

import { TestBed } from '@angular/core/testing';
import { App } from './app';

describe('App', () => {
  beforeEach(async () => {
    await TestBed.configureTestingModule({
      imports: [App],
    }).compileComponents();
  });

  it('should create the app', () => {
    const fixture = TestBed.createComponent(App);
    const app = fixture.componentInstance;
    expect(app).toBeTruthy();
  });

  it(`should have the 'front' title`, () => {
    const fixture = TestBed.createComponent(App);
    const app = fixture.componentInstance;
    expect(app.title).toEqual('front');
  });

  it('should render title', () => {
    const fixture = TestBed.createComponent(App);
    fixture.detectChanges();
    const compiled = fixture.nativeElement as HTMLElement;
    expect(compiled.querySelector('h1')?.textContent).toContain('Hello, front');
  });
});

